import java.util.*;
import java.io.*;

public class Main {
    static int N;
    static String S;
    static int[] dp;
    static int[] pre;
    static int[] suf;
    static int[] sum;

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        N = Integer.parseInt(br.readLine());
        S = br.readLine();
        dp = new int[S.length() + 1];
        pre = new int[S.length() + 1];
        suf = new int[S.length() + 1];
        sum = new int[S.length() + 1];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[0] = 0;
        for (int i = 0; i < S.length(); i++) {
            if (S.charAt(i) != '+') {
                sum[i + 1] = sum[i] + (S.charAt(i) - '0');
            } else {
                sum[i + 1] = sum[i];
            }
        }
        for (int i = 1; i <= S.length(); i++) {
            pre[i] = pre[i - 1];
            if (S.charAt(i - 1) != '+') {
                pre[i] = Math.max(pre[i], sum[i - 1]);
            }
        }
        for (int i = S.length() - 1; i >= 0; i--) {
            suf[i] = suf[i + 1];
            if (S.charAt(i) != '+') {
                suf[i] = Math.max(suf[i], sum[i + 1]);
            }
        }
        for (int i = 1; i <= S.length(); i++) {
            for (int j = 0; j < i; j++) {
                if (S.charAt(j) == '+' && S.charAt(i - 1) == '+') {
                    dp[i] = Math.min(dp[i], dp[j] + 1);
                } else if (S.charAt(j) == '+' && S.charAt(i - 1) != '+') {
                    int val = sum[j] + suf[i - 1];
                    if (val <= N) {
                        dp[i] = Math.min(dp[i], dp[j] + 1);
                    }
                } else if (S.charAt(j) != '+' && S.charAt(i - 1) == '+') {
                    int val = sum[j] + pre[i - 1];
                    if (val <= N) {
                        dp[i] = Math.min(dp[i], dp[j] + 1);
                    }
                } else if (S.charAt(j) != '+' && S.charAt(i - 1) != '+') {
                    int val = sum[j] + sum[i - 1];
                    if (val <= N) {
                        dp[i] = Math.min(dp[i], dp[j] + 1);
                    }
                }
            }
        }
        if (dp[S.length()] == Integer.MAX_VALUE) {
            System.out.println(-1);
        } else {
            System.out.println(dp[S.length()] - 1);
        }
    }
}
